import { useState } from "react";

const Box = ({ box }) => {
    const [on, setOn] = useState(box.on);

    return (
        <div 
            key={box.id} 
            className={`border-2 border-black h-10 w-10 ${on ? 'bg-gray-700' : 'bg-none'}`}
            onClick={() => setOn(!on)}
        ></div>
    );
}

export default Box;
